import React from 'react';
import { MDBDataTable } from 'mdbreact';

const DatatablePage = () => {
  const data = {
    columns: [
     data = listmahasiswa
    ]
  };

  return (
    <MDBDataTable
    
      data={data}
    />
  );
}

export default DatatablePage;
